	public static PaletteManager.PaletteInfo getRandomCharacterPalette() {
		PaletteManager.PaletteInfo paletteInfo = new PaletteManager.PaletteInfo();
		try {
			Integer integer = Rand.Next(10) + 1;
			Class javaClass = Class.forName("zombie.core.textures.PaletteManager");
			Field field = javaClass.getField("CharacterPalette" + integer.toString());
			paletteInfo.palette = (int[])((int[])field.get((Object)null));
			paletteInfo.name = "CharacterPalette" + integer.toString();
		} catch (Exception exception) {
			Logger.getLogger(GameApplet.class.getName()).log(Level.SEVERE, (String)null, exception);
		}

		return paletteInfo;
	}

